contracts/core/DappadSale.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "../interfaces/Interfaces.sol";
import "../errors/Errors.sol";

contract DappadSale is AccessControl {
    bytes32 public constant OWNER = keccak256("OWNER");
    bytes32 public constant ADMIN = keccak256("ADMIN");

    IDappadSale.Sale public sale;
    IDappadSale.SaleStatistics public saleStatistics;

    IERC20Extented public registerToken;
    IERC20Extented public investmentToken;
    IDappadStakeController public stakeControllerContract;
    IDappadVesting public vestingContract;

    mapping(address => IDappadSale.SaleRegisterDetails) public registerDetails;
    mapping(uint256 => IDappadSale.SaleTierDetails) public tierDetails;
    mapping(address => bool) public refunded;
    mapping(address => uint256) public investmentAmounts;

    event UserRegisteredSale(address user, uint256 tierIndex, uint256 registerTime, uint256 totalRegisters, uint256 totalRegisterTokenAmountLeft);
    event UserJoinedSale(address user, uint256 tierIndex, uint256 amount, uint256 investmentAmount, uint256 totalInvestmentAmount, uint256 totalParticipants, uint256 joinedTime, uint256 nftBalance);
    event UserJoinedFcfsSale(address user, uint256 tierIndex, uint256 amount, uint256 investmentAmount, uint256 totalInvestmentAmount, uint256 totalParticipants, uint256 joinedTime, uint256 nftBalance);
    event UserRefundedSale(address user, uint256 userTierIndex, uint256 investmentAmount, uint256 totalInvestmentAmount, uint256 refundedTime);
    event SalePausedUpdated(bool salePaused);
    event SaleCompleted(address projectOwnerFeeAddress, uint256 projectOwnerFeeAmount, address launchpadFeeAddress, uint256 launchpadFeeAmount, uint256 completedTime);
    event VestingContractUpdated(address vestingContractAddress);
    event StakeControllerContractUpdated(address stakeControllerContractAddress);
    event SaleAddressesUpdated(IDappadSale.SaleAddresses newSaleAddresses);
    event SaleDetailsUpdated(IDappadSale.SaleDetails newSaleDetails);
    event SaleFcfsDetailsUpdated(IDappadSale.SaleFcfsDetails newFcfsDetails);
    event SaleRefundDetailsUpdated(IDappadSale.SaleRefundDetails newRefundDetails);
    event SaleTicketDetailsUpdated(IDappadSale.SaleTicketDetails newTicketDetails);
    event SaleTierDetailsUpdated(uint256 tierIndex, IDappadSale.SaleTierDetails newTierDetails);
    event SaleTierDetailsBatchUpdated(IDappadSale.SaleTierDetails[] newTierDetails);

    constructor(IDappadSale.SaleParams memory saleParams) 
        notZeroAddress(saleParams.sale.saleAddresses.investmentTokenAddress) 
        notZeroAddress(saleParams.sale.saleAddresses.factoryContractAddress) 
        notZeroAddress(saleParams.sale.saleAddresses.ownerAddress) 
        notZeroAddress(saleParams.sale.saleAddresses.adminAddress) 
    {
        _setRoleAdmin(OWNER, OWNER);
        _setRoleAdmin(ADMIN, OWNER);

        _grantRole(OWNER, saleParams.sale.saleAddresses.ownerAddress);
        _grantRole(ADMIN, saleParams.sale.saleAddresses.adminAddress);

        if(bytes(saleParams.sale.saleDetails.saleName).length == 0) revert Errors.EmptySaleNameError();
        if (saleParams.sale.saleDetails.saleStart < block.timestamp) revert Errors.InvalidSaleStartDateError();
        if (saleParams.sale.saleDetails.saleEnd < block.timestamp) revert Errors.InvalidSaleEndDateError();
        if (saleParams.sale.saleDetails.saleStart >= saleParams.sale.saleDetails.saleEnd) revert Errors.InvalidSaleDurationError();
        if (saleParams.sale.saleDetails.maxInvestmentAmount <= 0) revert Errors.InvalidMaxInvestmentAmountError();
        if (saleParams.tierDetails.length == 0) revert Errors.EmptyTierDetailsError();

        sale = saleParams.sale;

        if(saleParams.sale.saleAddresses.registerTokenAddress != address(0)) registerToken = IERC20Extented(saleParams.sale.saleAddresses.registerTokenAddress);

        investmentToken = IERC20Extented(saleParams.sale.saleAddresses.investmentTokenAddress);

        if (saleParams.sale.saleAddresses.stakeControllerContractAddress != address(0)) {
            stakeControllerContract = IDappadStakeController(sale.saleAddresses.stakeControllerContractAddress);
        }

        for(uint256 i = 0; i < saleParams.tierDetails.length; i++) {
            tierDetails[i] = saleParams.tierDetails[i];
        }
    }

    modifier notZeroAddress(address _address) {
        _notZeroAddress(_address);
        _;
    }

    modifier onlyOwner(address _address) {
        _onlyOwner(_address);
        _;
    }

    modifier onlyOwnerOrAdmin(address _address) {
        _onlyOwnerOrAdmin(_address);
        _;
    }

    modifier whenSaleIsNotPaused() {
        _whenSaleIsNotPaused();
        _;
    }

    modifier hasEnoughAllowance(IERC20Extented token, address userAddress, uint256 amount) {
        _hasEnoughAllowance(token, userAddress, amount);
        _;
    }

    function registerSale() external whenSaleIsNotPaused notZeroAddress(msg.sender) returns (bool) {
        if (block.timestamp < sale.saleDetails.registerStart) revert Errors.RegisterNotStartedError();
        if (block.timestamp >= sale.saleDetails.registerEnd) revert Errors.RegisterAlreadyEndedError();
        if (registerDetails[msg.sender].registered) revert Errors.UserAlreadyRegisteredError();

        uint256 userTierIndex = 0;

        if (sale.saleAddresses.nftContractAddress != address(0)) {
            if (_getUserNftBalance(msg.sender) == 0) revert Errors.UserHasNoNFTError();
        }

        if (sale.saleAddresses.stakeControllerContractAddress != address(0)) {
            userTierIndex = stakeControllerContract.getUserTierIndex(msg.sender);
        }       

        if (sale.saleDetails.registerTokenEnabled && sale.saleAddresses.registerTokenAddress != address(0)) {
            saleStatistics.totalRegisterTokenAmountLeft += sale.saleDetails.registerTokenAmount;

            registerDetails[msg.sender] = IDappadSale.SaleRegisterDetails({
                registerTokenAmount: sale.saleDetails.registerTokenAmount,
                tierIndex: userTierIndex,
                registered: true
            });

            bool successfullyTransfered = registerToken.transferFrom(msg.sender, address(this), sale.saleDetails.registerTokenAmount);
            if (!successfullyTransfered) revert Errors.TokenTransferFailedError();
        } else {
            registerDetails[msg.sender] = IDappadSale.SaleRegisterDetails({
                registerTokenAmount: 0,
                tierIndex: userTierIndex,
                registered: true
            });
        }

        saleStatistics.totalRegisters++;

        emit UserRegisteredSale(msg.sender, userTierIndex, block.timestamp, saleStatistics.totalRegisters, saleStatistics.totalRegisterTokenAmountLeft);

        return true;
    }

    function joinSale(uint256 amount, bytes32[] calldata whitelistProof, bytes32[] calldata ticketProof) external whenSaleIsNotPaused notZeroAddress(msg.sender) hasEnoughAllowance(investmentToken, msg.sender, amount) returns (bool) {
        if(!registerDetails[msg.sender].registered) revert Errors.UserNotRegisteredError();
        if (block.timestamp < sale.saleDetails.saleStart) revert Errors.SaleNotStartedError();

        if (sale.fcfsDetails.fcfsSaleDuration > 0) {
            if (block.timestamp >= (sale.saleDetails.saleEnd - sale.fcfsDetails.fcfsSaleDuration)) revert Errors.FCFSSaleAlreadyStartedError();
        } else {
            if (block.timestamp >= sale.saleDetails.saleEnd) revert Errors.SaleAlreadyEndedError();
        }

        if (amount == 0) revert Errors.InvalidAmountError();

        if (sale.saleAddresses.nftContractAddress != address(0)) {
            if (_getUserNftBalance(msg.sender) == 0) revert Errors.UserHasNoNFTError();
        }

        uint256 userTierIndex = registerDetails[msg.sender].tierIndex;

        if(userTierIndex == 0) {
            if (tierDetails[0].whitelistMerkleRoot != bytes32(0)) {
                if (!checkWhitelistEligibility(msg.sender, userTierIndex, whitelistProof)) revert Errors.UserNotWhitelistedError();
            } else {
                revert Errors.TierOneCannotJoinStakerRoundError();
            }
        }

        if (investmentToken.balanceOf(msg.sender) < amount) revert Errors.InsufficientBalanceError();
        if (amount < tierDetails[userTierIndex].minInvestmentAmount) revert Errors.MinimumInvestmentNotReachedError();

        if (sale.ticketDetails.ticketMerkleRoot != bytes32(0) && checkTicketEligibility(msg.sender, ticketProof)) {
            if (investmentAmounts[msg.sender] + amount > (tierDetails[userTierIndex].maxInvestmentAmount + (sale.ticketDetails.ticketPrice * tierDetails[userTierIndex].ticketAmount))) revert Errors.MaximumInvestmentReachedError();
        } else {
            if (investmentAmounts[msg.sender] + amount > tierDetails[userTierIndex].maxInvestmentAmount) revert Errors.MaximumInvestmentReachedError();
        }

        if (tierDetails[userTierIndex].totalInvestmentAmount + amount > tierDetails[userTierIndex].tierMaxInvestmentAmount) revert Errors.MaxTierInvestmentReachedError();
        if (saleStatistics.totalInvestmentAmount + amount > sale.saleDetails.maxInvestmentAmount) revert Errors.MaxTotalInvestmentReachedError();

        saleStatistics.totalInvestmentAmount += amount;

        if(investmentAmounts[msg.sender] == 0) {
            saleStatistics.totalParticipants++;
            tierDetails[userTierIndex].totalParticipants++;
        }

        investmentAmounts[msg.sender] += amount;
        tierDetails[userTierIndex].totalInvestmentAmount += amount;

        emit UserJoinedSale(msg.sender, userTierIndex, amount, investmentAmounts[msg.sender], saleStatistics.totalInvestmentAmount, saleStatistics.totalParticipants, block.timestamp, _getUserNftBalance(msg.sender));

        bool successfullyTransfered = investmentToken.transferFrom(msg.sender, address(this), amount);
        if (!successfullyTransfered) revert Errors.TokenTransferFailedError();

        if (sale.saleDetails.registerTokenEnabled && sale.saleAddresses.registerTokenAddress != address(0) && registerDetails[msg.sender].registerTokenAmount > 0) {
            uint256 registerTokenAmount = registerDetails[msg.sender].registerTokenAmount;

            saleStatistics.totalRegisterTokenAmountLeft -= registerDetails[msg.sender].registerTokenAmount;
            registerDetails[msg.sender].registerTokenAmount = 0;

            bool successfullyTransferedRA = registerToken.transfer(msg.sender, registerTokenAmount);
            if (!successfullyTransferedRA) revert Errors.TokenTransferFailedError();
        }

        return true;
    }

    function joinFcfsSale(uint256 amount, bytes32[] calldata whitelistProof) external whenSaleIsNotPaused notZeroAddress(msg.sender) hasEnoughAllowance(investmentToken, msg.sender, amount) returns (bool) {
        if (sale.fcfsDetails.fcfsSaleDuration <= 0) revert Errors.FCFSSaleNotEnabledError();
        if (block.timestamp < (sale.saleDetails.saleEnd - sale.fcfsDetails.fcfsSaleDuration)) revert Errors.FCFSSaleNotStartedError();
        if (block.timestamp >= sale.saleDetails.saleEnd) revert Errors.SaleAlreadyEndedError();

        if (amount == 0) revert Errors.InvalidAmountError();

        if (sale.saleAddresses.nftContractAddress != address(0)) {
            if (_getUserNftBalance(msg.sender) == 0) revert Errors.UserHasNoNFTError();
        }

        uint256 userTierIndex = 0;

        if (sale.saleAddresses.stakeControllerContractAddress != address(0)) {
           userTierIndex = stakeControllerContract.getUserTierIndex(msg.sender);
        }

        if (userTierIndex == 0 && tierDetails[0].whitelistMerkleRoot != bytes32(0)) {
            if (!checkWhitelistEligibility(msg.sender, userTierIndex, whitelistProof)) revert Errors.UserNotWhitelistedError();
        }

        if (investmentToken.balanceOf(msg.sender) < amount) revert Errors.InsufficientBalanceError();
        if (amount < tierDetails[userTierIndex].minInvestmentAmount) revert Errors.MinimumInvestmentNotReachedError();
        if (investmentAmounts[msg.sender] + amount > (tierDetails[userTierIndex].maxInvestmentAmount * sale.fcfsDetails.fcfsSaleMultiplier / 1000)) revert Errors.MaximumInvestmentReachedError();

        if (saleStatistics.totalInvestmentAmount + amount > sale.saleDetails.maxInvestmentAmount) revert Errors.MaxTotalInvestmentReachedError();

        saleStatistics.totalInvestmentAmount += amount;

        if(investmentAmounts[msg.sender] == 0) {
            saleStatistics.totalParticipants++;
            tierDetails[userTierIndex].totalParticipants++;
        }

        investmentAmounts[msg.sender] += amount;
        tierDetails[userTierIndex].totalInvestmentAmount += amount;

        emit UserJoinedFcfsSale(msg.sender, userTierIndex, amount, investmentAmounts[msg.sender], saleStatistics.totalInvestmentAmount, saleStatistics.totalParticipants, block.timestamp, _getUserNftBalance(msg.sender));

        bool successfullyTransfered = investmentToken.transferFrom(msg.sender, address(this), amount);
        if (!successfullyTransfered) revert Errors.TokenTransferFailedError();

        if (sale.saleDetails.registerTokenEnabled && sale.saleAddresses.registerTokenAddress != address(0) && registerDetails[msg.sender].registerTokenAmount > 0) {
            uint256 registerTokenAmount = registerDetails[msg.sender].registerTokenAmount;

            saleStatistics.totalRegisterTokenAmountLeft -= registerDetails[msg.sender].registerTokenAmount;
            registerDetails[msg.sender].registerTokenAmount = 0;

            bool successfullyTransferedRA = registerToken.transfer(msg.sender, registerTokenAmount);
            if (!successfullyTransferedRA) revert Errors.TokenTransferFailedError();
        }

        return true;
    }

    function refund() external notZeroAddress(msg.sender) returns (bool) {
        if (investmentAmounts[msg.sender] == 0) revert Errors.NotJoinedSaleError();
        if (vestingContract.getAnyVestingClaimed(msg.sender)) revert Errors.FirstVestingAlreadyClaimedError();
        if (block.timestamp <= sale.saleDetails.saleEnd) revert Errors.SaleNotEndedError();
        if (!sale.refundDetails.refundEnabled) revert Errors.RefundNotEnabledError();
        if (!(block.timestamp > sale.saleDetails.saleEnd && block.timestamp <= sale.saleDetails.saleEnd + sale.refundDetails.refundDuration)) revert Errors.RefundPeriodOverError();
        if (refunded[msg.sender]) revert Errors.AlreadyRefundedError();

        if (sale.saleAddresses.nftContractAddress != address(0)) {
            if (_getUserNftBalance(msg.sender) == 0) revert Errors.UserHasNoNFTError();
        }

        uint256 userTierIndex = registerDetails[msg.sender].tierIndex;

        saleStatistics.totalInvestmentAmount -= investmentAmounts[msg.sender];
        //tierDetails[userTierIndex].totalInvestmentAmount -= investmentAmounts[msg.sender];
        investmentAmounts[msg.sender] = 0;

        refunded[msg.sender] = true;

        if (investmentToken.balanceOf(address(this)) < investmentAmounts[msg.sender]) revert Errors.InsufficientContractBalanceError();

        emit UserRefundedSale(msg.sender, userTierIndex, investmentAmounts[msg.sender], saleStatistics.totalInvestmentAmount, block.timestamp);

        bool successfullyTransfered = investmentToken.transfer(msg.sender, investmentAmounts[msg.sender]);
        if (!successfullyTransfered) revert Errors.TokenTransferFailedError();

        return true;
    }

    function completeSale() external notZeroAddress(msg.sender) onlyOwnerOrAdmin(msg.sender) returns (bool) {
        if (block.timestamp <= sale.saleDetails.saleEnd) revert Errors.SaleNotEndedError();
        if (investmentToken.balanceOf(address(this)) == 0) revert Errors.InsufficientBalanceError();
        if (sale.refundDetails.refundEnabled && block.timestamp <= sale.saleDetails.saleEnd + sale.refundDetails.refundDuration) revert Errors.RefundPeriodOverError();

        uint256 balance = investmentToken.balanceOf(address(this));
        uint256 projectOwnerFeeAmount = (balance * sale.saleDetails.projectOwnerFeePercentage) / 10000;
        uint256 launchpadFeeAmount = balance - projectOwnerFeeAmount;

        bool successfullyTransfered = investmentToken.transfer(sale.saleAddresses.projectOwnerFeeAddress, projectOwnerFeeAmount);
        if (!successfullyTransfered) revert Errors.TokenTransferFailedError();

        bool successfullyTransferedSecond = investmentToken.transfer(sale.saleAddresses.launchpadFeeAddress, launchpadFeeAmount);
        if (!successfullyTransferedSecond) revert Errors.TokenTransferFailedError();

        if (sale.saleAddresses.registerTokenAddress != address(0) && registerToken.balanceOf(address(this)) > 0) {
            bool successfullyTransferedThird = registerToken.transfer(sale.saleAddresses.launchpadFeeAddress, registerToken.balanceOf(address(this)));
            if (!successfullyTransferedThird) revert Errors.TokenTransferFailedError();
        }

        emit SaleCompleted(sale.saleAddresses.projectOwnerFeeAddress, projectOwnerFeeAmount, sale.saleAddresses.launchpadFeeAddress, launchpadFeeAmount, block.timestamp);

        return true;
    }

    function withdrawRegisterToken() external notZeroAddress(msg.sender) onlyOwnerOrAdmin(msg.sender) returns (bool) {
        if (block.timestamp <= sale.saleDetails.saleEnd) revert Errors.SaleNotEndedError();

        bool successfullyTransfered = registerToken.transfer(msg.sender, registerToken.balanceOf(address(this)));
        if (!successfullyTransfered) revert Errors.TokenTransferFailedError();

        return true;
    }

    function emergencyOnly() external notZeroAddress(msg.sender) onlyOwnerOrAdmin(msg.sender) returns (bool) {
        bool successfullyTransferedIT = investmentToken.transfer(msg.sender, investmentToken.balanceOf(address(this)));
        if (!successfullyTransferedIT) revert Errors.TokenTransferFailedError();

        return true;
    }

    function setSalePaused(bool salePaused) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.saleDetails.salePaused = salePaused;

        emit SalePausedUpdated(salePaused);

        return true;
    }

    function setVestingContract(address vestingContractAddress) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.saleAddresses.vestingContractAddress = vestingContractAddress;

        if (vestingContractAddress != address(0)) {
            vestingContract = IDappadVesting(vestingContractAddress);
        }

        emit VestingContractUpdated(vestingContractAddress);

        return true;
    }

    function setStakeControllerContract(address stakeControllerContractAddress) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.saleAddresses.stakeControllerContractAddress = stakeControllerContractAddress;

        if (stakeControllerContractAddress != address(0)) {
            stakeControllerContract = IDappadStakeController(stakeControllerContractAddress);
        }

        emit StakeControllerContractUpdated(stakeControllerContractAddress);

        return true;
    }

    function setSaleAddresses(IDappadSale.SaleAddresses memory newSaleAddresses) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.saleAddresses = newSaleAddresses;

        if (newSaleAddresses.registerTokenAddress != address(0)) {
            registerToken = IERC20Extented(newSaleAddresses.registerTokenAddress);
        }

        if (newSaleAddresses.investmentTokenAddress != address(0)) {
            investmentToken = IERC20Extented(newSaleAddresses.investmentTokenAddress);
        }

        if (newSaleAddresses.stakeControllerContractAddress != address(0)) {
            stakeControllerContract = IDappadStakeController(newSaleAddresses.stakeControllerContractAddress);
        }

        if (newSaleAddresses.vestingContractAddress != address(0)) {
            vestingContract = IDappadVesting(newSaleAddresses.vestingContractAddress);
        }

        emit SaleAddressesUpdated(newSaleAddresses);

        return true;
    }

    function setSaleDetails(IDappadSale.SaleDetails memory newSaleDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.saleDetails = newSaleDetails;

        emit SaleDetailsUpdated(newSaleDetails);

        return true;
    }

    function setSaleFcfsDetails(IDappadSale.SaleFcfsDetails memory newFcfsDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.fcfsDetails = newFcfsDetails;

        emit SaleFcfsDetailsUpdated(newFcfsDetails);

        return true;
    }

    function setRefundDetails(IDappadSale.SaleRefundDetails memory newRefundDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.refundDetails = newRefundDetails;

        emit SaleRefundDetailsUpdated(newRefundDetails);

        return true;
    }

    function setTicketDetails(IDappadSale.SaleTicketDetails memory newTicketDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        sale.ticketDetails = newTicketDetails;

        emit SaleTicketDetailsUpdated(newTicketDetails);

        return true;
    }

    function setTierDetails(uint256 tierIndex, IDappadSale.SaleTierDetails memory newTierDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        tierDetails[tierIndex] = newTierDetails;

        emit SaleTierDetailsUpdated(tierIndex, newTierDetails);

        return true;
    }

    function setTierDetailsBatch(IDappadSale.SaleTierDetails[] calldata newTierDetails) external onlyOwnerOrAdmin(msg.sender) returns (bool) {
        uint256 tierCount = newTierDetails.length;

        for(uint256 i = 0; i < tierCount; i++) {
            tierDetails[i] = newTierDetails[i];
        }

        emit SaleTierDetailsBatchUpdated(newTierDetails);

        return true;
    }

    function checkWhitelistEligibility(address userAddress, uint256 userTierIndex, bytes32[] calldata proof) public view notZeroAddress(userAddress) returns (bool) {
        bytes32 leaf = keccak256(bytes.concat(keccak256(abi.encode(userAddress))));
        return MerkleProof.verify(proof, tierDetails[userTierIndex].whitelistMerkleRoot, leaf);
    }

    function checkTicketEligibility(address userAddress, bytes32[] calldata proof) public view notZeroAddress(userAddress) returns (bool) {
        bytes32 leaf = keccak256(bytes.concat(keccak256(abi.encode(userAddress))));
        return MerkleProof.verify(proof, sale.ticketDetails.ticketMerkleRoot, leaf);
    }

    function getUserInvestmentAmount(address userAddress) external view notZeroAddress(userAddress) returns (uint256) {
        return investmentAmounts[userAddress];
    }

    function getRefundEnabled() external view returns (bool) {
        return sale.refundDetails.refundEnabled;
    }

    function getUserRefunded(address userAddress) external view notZeroAddress(userAddress) returns (bool) {
        return refunded[userAddress];
    }

    function getTierDetailsByIndex(uint256 tierIndex) external view returns (IDappadSale.SaleTierDetails memory) {
        return tierDetails[tierIndex];
    }

    function getAllTierDetails() external view returns (IDappadSale.SaleTierDetails[] memory) {
        uint256 tierCount = 0;

        if (sale.saleAddresses.stakeControllerContractAddress == address(0)) {
            tierCount = 1;
        }

        IDappadSale.SaleTierDetails[] memory _tierDetails = new IDappadSale.SaleTierDetails[](tierCount);

        for(uint256 i = 0; i < tierCount; i++) {
            _tierDetails[i] = tierDetails[i];
        }

        return _tierDetails;
    }

    function getTierCount() public view returns (uint256) {
        if (sale.saleAddresses.stakeControllerContractAddress == address(0)) return 0;

        uint256 tierCount = stakeControllerContract.getTierCount();
        if (tierCount == 0) revert Errors.NoTierDetailsFoundError();

        return tierCount;
    }

    function getSaleTokenPrice() external view returns (uint256) {
        return sale.saleDetails.saleTokenPrice;
    }

    function getIsSaleActive() external view returns (bool) {
        return block.timestamp >= sale.saleDetails.saleStart && block.timestamp <= sale.saleDetails.saleEnd;
    }

    function getSaleEndDate() external view returns (uint256) {
        return sale.saleDetails.saleEnd;
    }

    function getSaleTokenAddress() external view returns (address) {
        return sale.saleAddresses.saleTokenAddress;
    }

    function getFactoryContractAddress() external view returns (address) {
        return sale.saleAddresses.factoryContractAddress;
    }

    function getStakeControllerContractAddress() external view returns (address) {
        return sale.saleAddresses.stakeControllerContractAddress;
    }

    function _getUserNftBalance(address userAddress) internal view notZeroAddress(userAddress) returns (uint256) {
        if (sale.saleAddresses.nftContractAddress == address(0)) {
            return 0;
        } else {
            return IERC721(sale.saleAddresses.nftContractAddress).balanceOf(msg.sender);
        }
    }

    function _notZeroAddress(address _address) internal pure {
        if (_address == address(0)) revert Errors.ZeroAddressError();
    }

    function _onlyOwner(address _address) internal view {
        if (!hasRole(OWNER, _address)) revert Errors.UnauthorizedError();
    }

    function _onlyOwnerOrAdmin(address _address) internal view {
        if (!hasRole(OWNER, _address) && !hasRole(ADMIN, _address)) revert Errors.UnauthorizedError();
    }

    function _whenSaleIsNotPaused() internal view {
        if(sale.saleDetails.salePaused) revert Errors.SaleIsPausedError();
    }

    function _hasEnoughAllowance(IERC20Extented token, address userAddress, uint256 amount) internal view {
        uint256 userAllowance = token.allowance(userAddress, address(this));
        if(amount > userAllowance) revert Errors.InsufficientAllowanceError();
    }
}

contracts/core/DappadSaleFactory.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./DappadSale.sol";
import "../interfaces/Interfaces.sol";
import "../errors/Errors.sol";

contract DappadSaleFactory is AccessControl {
    bytes32 public constant OWNER = keccak256("OWNER");
    bytes32 public constant ADMIN = keccak256("ADMIN");

    address[] public allSales;

    event SaleCreated(
        string saleName,
        uint256 saleStart,
        uint256 saleEnd,
        uint256 maxInvestmentAmount,
        address investmentTokenAddress,
        address saleTokenAddress,
        address factoryContractAddress
    );

    constructor(IDappadSaleFactory.SaleFactoryParams memory saleFactoryParams) {
        _setRoleAdmin(OWNER, OWNER);
        _setRoleAdmin(ADMIN, OWNER);

        _grantRole(OWNER, msg.sender);
        _grantRole(ADMIN, saleFactoryParams.adminAddress);
    }

    modifier notZeroAddress(address _address) {
        _notZeroAddress(_address);
        _;
    }

    modifier onlyOwner(address _address) {
        _onlyOwner(_address);
        _;
    }

    modifier onlyOwnerOrAdmin(address _address) {
        _onlyOwnerOrAdmin(_address);
        _;
    }

    function createSale(IDappadSale.SaleParams memory _saleParams)
        public
        onlyOwnerOrAdmin(msg.sender)
        notZeroAddress(_saleParams.sale.saleAddresses.investmentTokenAddress)
        notZeroAddress(_saleParams.sale.saleAddresses.projectOwnerFeeAddress)
        notZeroAddress(_saleParams.sale.saleAddresses.launchpadFeeAddress)
        returns (bool)
    {
        IDappadSale.SaleParams memory saleParams = _saleParams;

        if (bytes(saleParams.sale.saleDetails.saleName).length == 0) {
            revert Errors.EmptySaleNameError();
        }
        if (saleParams.sale.saleDetails.saleStart < block.timestamp) {
            revert Errors.InvalidSaleStartDateError();
        }
        if (saleParams.sale.saleDetails.saleEnd < block.timestamp) {
            revert Errors.InvalidSaleEndDateError();
        }
        if (saleParams.sale.saleDetails.saleStart >= saleParams.sale.saleDetails.saleEnd) {
            revert Errors.InvalidSaleDurationError();
        }
        if (saleParams.sale.saleDetails.maxInvestmentAmount == 0) {
            revert Errors.InvalidMaxInvestmentAmountError();
        }
        if (saleParams.tierDetails.length == 0) {
            revert Errors.EmptyTierDetailsError();
        }

        DappadSale newSale = new DappadSale(saleParams);

        allSales.push(address(newSale));

        emit SaleCreated(
            saleParams.sale.saleDetails.saleName,
            saleParams.sale.saleDetails.saleStart,
            saleParams.sale.saleDetails.saleEnd,
            saleParams.sale.saleDetails.maxInvestmentAmount,
            saleParams.sale.saleAddresses.investmentTokenAddress,
            saleParams.sale.saleAddresses.saleTokenAddress,
            address(this)
        );

        return true;
    }

    function getSaleCount() external view returns (uint256) {
        return allSales.length;
    }

    function getSale(uint256 index) external view returns (address) {
        if (index >= allSales.length) {
            revert Errors.InvalidSaleIndexError();
        }
        return allSales[index];
    }

    function getIsSaleActive(uint256 index) external view returns (bool) {
        if (index >= allSales.length) {
            revert Errors.InvalidSaleIndexError();
        }
        return IDappadSale(allSales[index]).getIsSaleActive();
    }

    function _notZeroAddress(address _address) internal pure {
        if (_address == address(0)) revert Errors.ZeroAddressError();
    }

    function _onlyOwner(address _address) internal view {
        if (!hasRole(OWNER, _address)) revert Errors.UnauthorizedError();
    }

    function _onlyOwnerOrAdmin(address _address) internal view {
        if (!hasRole(OWNER, _address) && !hasRole(ADMIN, _address)) revert Errors.UnauthorizedError();
    }
}

